  merged.forEach(obj => {
    if (!arr2.some(otherObj => otherObj.stepId === obj.stepId && otherObj.fieldId === obj.fieldId)) {
      // If the second array does not contain the current object, use the message from the first object
      obj.message = obj.message || arr1.find(otherObj => otherObj.stepId === obj.stepId && otherObj.fieldId === obj.fieldId).message;
    }
  });

