Here's a JavaScript implementation for packing and unpacking an array of entities into an ArrayBuffer. The entities have the fields `id` (4 bits) and `size` (3 bits).

```javascript
function packEntities(entities) {
  const buffer = new ArrayBuffer(entities.length);
  const view = new DataView(buffer);

  for (let i = 0; i < entities.length; i++) {
    const entity = entities[i];
    const id = entity.id & 0xF; // Masking to get the 4 least significant bits
    const size = entity.size & 0x7; // Masking to get the 3 least significant bits

    view.setUint8(i * (id + size), id);
    view.setUint8(i * (id + size) + 1, size);

    // Set the remaining bits of the byte to 0
    view.setUint8(i * (id + size) + 2, (id + size) > 1 ? (~((id << 5) | (size << 2))) & 0xFF : 0);
  }

  return buffer;
}

function unpackEntities(buffer, length) {
  const view = new DataView(buffer);
  const entities = [];

  for (let i = 0; i < length; i++) {
    const idByte = view.getUint8(i);
    const sizeByte = view.getUint8(i + 1);

    const id = idByte & 0xF; // Masking to get the 4 least significant bits
    const size = sizeByte & 0x7; // Masking to get the 3 least significant bits

    const startIndex = i * (id + size) + 2;
    const endIndex = startIndex + Math.min(id + size - 2, 1);

    entities.push({
      id: id,
      size: size,
      data: new Uint8Array(buffer.slice(startIndex, endIndex))
    });
  }

  return entities;
}
```

In the `packEntities` function, we create an ArrayBuffer and a DataView to manipulate the buffer. We iterate through the entities and pack each one into the buffer. We set the `id` and `size` fields into the buffer, and then set the remaining bits of the byte to 0.

In the `unpackEntities` function, we create a DataView to read the buffer. We iterate through the buffer and unpack each entity. We calculate the start and end index for each entity based on its `id` and `size`, and then create a new Uint8Array for the entity's data.

